INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (60005, "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 2, "", 0, 0, 596, "", 2, 0, 0, 4);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (60005, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 2, "", 0, 0, 597, "", 2, 0, 0, 4);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (60005, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 0, 190804, 598, "カリン", 3, 2, 0, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (60005, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, "", 0, 190804, 599, "カリン", 3, 3, 7, 0);
